import React from "react";
import Link from "next/link";

const TileBarItem = (props) => {

 const {isLink, linkTo, items} = props;

  return (
  <div className="card">
    <h2 className="card-title">{props.text}</h2>
    <div className="lower-titles-wrapper">
    {isLink ? 
    items.map(item=> <a key={item+1} className="lower-titles lower-titles-link" href={linkTo}>{item}</a>):
    items.map(item=> <p key={item+1} className="lower-titles">{item}</p>)}
    </div>
    {props.hasOwnProperty('image')? <img className="card-image" src={props.image} alt="woman enjoying time at spa"/>: null}
  </div>)
};

export default TileBarItem;
